import { Navbar } from "reactstrap";

function App(props) {
  return (
    <div className="App">
      <Navigation />
      <div className="container-fluid">
        <div className="row">
          <div className="col-sm-12">
            <Linksr1 text="hello"></Linksr1>
          </div>
        </div>
        <div className="row">
          <div className="col-sm-12">
            <Linksr2></Linksr2>
          </div>
        </div>
        <div className="row">
          <div className="col-sm-12">
            <Linksr3></Linksr3>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
